import React from "react";
import { Tile } from "../types";
import cn from "classnames";

interface Props {
  tile: Tile;
}

export default React.memo<Props>(({ tile }) => {
  return <React.Fragment>
    <div className={cn("tile", { dark: tile.d })}>
      <p>{tile.tile.join(",")}</p>
    </div>
  </React.Fragment>;
});
